import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import AppSlice from '../redux/appSlice';
import mapSlice from '../redux/mapSlice';
import InputBase from '@mui/material/InputBase';
import SearchIcon from '@mui/icons-material/Search';
import { styled, alpha } from '@mui/material/styles';
import AppBar from '@mui/material/AppBar';

import Button from '@mui/material/Button';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';

import Checkbox from '@mui/material/Checkbox';


import FavoriteBorder from '@mui/icons-material/FavoriteBorder';
import Favorite from '@mui/icons-material/Favorite';

import ResultDrawer from './resultdrawer'
import Wheel from '../components/wheel';
import { right } from '@popperjs/core';

import { getServiceObject } from './gmap';

import { createGoogleRequest, doGoogleMapSearchPromise } from './mapapi';

let userLocation = {
  lat: 35.41221,
  lng: 139.4130
};

let searchResults;


const Search = styled('div')(({ theme }) => ({
  position: 'relative',
  borderRadius: theme.shape.borderRadius,
  backgroundColor: alpha(theme.palette.common.white, 0.15),
  '&:hover': {
    backgroundColor: alpha(theme.palette.common.white, 0.25),
  },
  marginLeft: 0,
  width: '100%',
  [theme.breakpoints.up('sm')]: {
    marginLeft: theme.spacing(1),
    width: '50%',
  },
}));

const SearchIconWrapper = styled('div')(({ theme }) => ({
  padding: theme.spacing(0, 2),
  height: '100%',
  position: 'absolute',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  zIndex: 2000
}));

const StyledInputBase = styled(InputBase)(({ theme }) => ({
  color: 'inherit',
  '& .MuiInputBase-input': {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(4)})`,
    transition: theme.transitions.create('width'),
    width: '100%',
    [theme.breakpoints.up('sm')]: {
      width: '300%',
      '&:focus': {
        width: '100%',
      },
    },
  },
}));

const PartyButton = styled(Button)(({ theme }) => ({

  fontSize: '1.8rem',

  padding: theme.spacing(0, 0, 0, 0),
  textAlign: 'right',

}))

const SearchResultsElementMemo = React.memo(props => {
  console.log(searchResults);
  return <ResultDrawer results={props.results}></ResultDrawer>;
});


export default function SearchAppBar() {

  const inputValue = useSelector(state => state.app.inputValue);
  const dispatch = useDispatch();
  let keyword;

  const trySearch = () => {

    let req = {
      keyword: inputValue,
      radius: 1000,
      userLoc: userLocation,
      useGoogle: true,
      useHotPepper: true,
      useGurunabi: true,
      isDone:false,
    };
    doGoogleMapSearchPromise(createGoogleRequest(req),getServiceObject()).then((results) => {

      dispatch(mapSlice.actions.setSearchResults(results));
      console.log(searchResults);

    }).catch((status) => {
      console.log(status);

    })


  }

  const handleChange = (e) => {
    dispatch(AppSlice.actions.handleInputField(e.target.value));
  }

  return (
    <div>
      <Box
        sx={{ flexGrow: 1 }}>
        <AppBar
          position="static"
          sx={{ zIndex: (theme) => theme.zIndex.drawer + 100 }}
        >
          <Toolbar>
            <IconButton
              size="large"
              edge="start"
              color="inherit"
              aria-label="menu"
              sx={{ mr: 2 }}
              onClick={() => {
                dispatch(AppSlice.actions.setResultsListToggle());
              }}
            >
              <MenuIcon />
            </IconButton>
            <Search>
              <SearchIconWrapper>
                <IconButton
                  size="large"
                  edge="start"
                  color="inherit"
                  aria-label="menu"
                  sx={{ mr: 2 }}
                  onClick={() => {
                    trySearch();
                  }}
                >
                  <SearchIcon />
                </IconButton>
              </SearchIconWrapper>
              <StyledInputBase

                onChange={handleChange}
                ref={keyword}
                placeholder="例：ラーメン　二郎系"

              />
            </Search>
            <Button sx={{ ml: 1.5 }} onClick={()=>{dispatch(mapSlice.actions.requestUserLoc())}} variant="contained">Advanced</Button>
            <Checkbox sx={{ ml: 1 }} icon={<FavoriteBorder />} checkedIcon={<Favorite />} />
            <Checkbox sx={{ ml: 1 }} icon={<FavoriteBorder />} checkedIcon={<Favorite />} />
            <Checkbox sx={{ ml: 1 }} icon={<FavoriteBorder />} checkedIcon={<Favorite />} />
            <PartyButton sx={{ margin: '0 auto', textAlign: 'right' }} color="warning" variant="contained">🎯</PartyButton>

            <PartyButton sx={{ margin: '0 2px', textAlign: 'right' }} color="warning" variant="contained">🗺</PartyButton>
          </Toolbar>
        </AppBar>
      </Box>
      <SearchResultsElementMemo results={searchResults}></SearchResultsElementMemo>
    </div>
  );
}
